import React from 'react';
import styled from 'styled-components';
import { CreateItem } from './CreateItem';
import { addDesk } from '../store/reducers/deskReducer';
import { useAppSelector, useAppDispatch } from '../store/hooks';
import { CreateButton } from './CreateButton';
import { FormDialog as Form } from './Form';

export const ProfileDesks: React.FC = () => {
  const desks = useAppSelector(state => state.desks.desks);
  const dispatch = useAppDispatch();

  const addClickHandler = () => {
    return <Form isOpen={true} />
    // dispatch(addDesk({title: 'Test!'}));
  };

  return (
    <StyledContainer>
      {desks.map((desk: { title: string; id: string; })=> {
      return (
        <CreateItem
          title={desk.title}
          href={desk.id}
        />
      );
    })}
      <CreateButton
        title='Create desk!'
        onClick={addClickHandler}
      />
    </StyledContainer>
  );
};


const StyledContainer = styled.div`
  display: flex;
  justify-content: flex-start;
  flex-direction: row;
  flex-wrap: wrap;
  padding: 30px;
`;
